import FontAwesomeIcon from "@fortawesome/fontawesome-svg-core";

const FormBar = ({ name }) => {
  return (
    <a className="single-form-link">
      <div>{name}</div>
      <div>
        Wypełnij online <FontAwesomeIcon icon={"file-alt"} />
      </div>
    </a>
  );
};

export default FormBar;
